import React, { Component } from "react";
import { withCookies } from 'react-cookie';
import "./index.css";

class EmailSent extends Component {
	constructor(props) {
		super(props);

		this.state = {
			style: ""
		}
	}

	changeStyle = (option) => {
		this.setState({ style: option })
	}

	render() {
		return (
			<div>
				<button id="myBtn">Open Modal</button>

				{/* <!-- The Modal --> */}
				<div id="myModal"
						 className="modal"
						 style={{display: this.state.style}}
						 onClick={this.changeStyle("block")}
						 >

					{/* <!-- Modal content --> */}
					<div className="modal-content">
						<span className="close"
									style={{display: this.state.style}}
									onClick={this.changeStyle("none")}
						>&times;</span>
						<p>Some text in the Modal..</p>
					</div>

				</div>
			</div>
		)
	}
};

export default withCookies(EmailSent);
